import React from 'react';

import Router from './shared/Router';

const App = () => {
  if (process.env.NODE_ENV === 'production') {
    console = window.console || {};
    console.log = function no_console() {};
    console.warn = function no_console() {};
    console.error = function () {};
  }
  return (
    <div>
      <Router />
    </div>
  );
};

export default App;
